import React from 'react';
import styles from './Navigation.module.css';
const Navigation = () => {

    const navItems = [
        'Home',
        'TV Shows',
        'Movies',
        'New & Popular',
        'My List'
    ]


    return (
        <div className={styles.navigation}>
            <ul>
                {navItems.map((item) => (
                    <li>{item}</li>
                ))}

            </ul>
        </div>
    );
};

export default Navigation;
